import { Link } from "next/link";

const PRODUCT = [];

function ProductPage() {
  return (
    <>
      <h1>프로덕트 페이지</h1>
      <ul>
        <li>
          <Link to="/product/product-1">Product1</Link>
        </li>
        <li>
          <Link to="/product/product-2">Product2</Link>
        </li>
        <li>
          <Link to="/product/product-3">Product3</Link>
        </li>
      </ul>
    </>
  );
}
export default ProductPage;
